import "./Header.scss";

export const Header = () => {
  return (
    <div className="Header">
      <h1>Adam Kliegman</h1>
      <div className="Header__links">
        <a href="mailto:adam.j.kliegman@gmail.com">adam.j.kiegman@gmail.com</a>
      </div>
    </div>
  );
};
